s.<\/p><p> It provides access to information contained in the MetPetDB system which contains information about rock samples, subsamples, images, and chemical analyses. Users can search for samples close to their location, at a specific latitude and longitude, or any specifically named geographic location. In addition, searches can be further refined by rock type, metamorphic grade, sample owner and minerals available in the sample. For each sample, users can view all the relevant data available in the database.<\/p><p> <a href="http://wiki.cs.rpi.edu/trac/metpetdb/wiki/IphoneApp" title="More about iPhone app">Learn More<\/a>.<\/p><\/div>',FCg="<img src='",awg="<input name='%NAME%' type='radio'/>",$vg="<input type='checkbox'/>",_2g='<span class="cell">',B2g='<span class="cell-contents">Cell Contents: ',A2g='<span class="error-message">',Vbh='<span class="igsn">IGSN<\/span> ',Xeh='<span id="clear-link"><\/span>',X0g='<span id="page-category" class="hide"><\/span><span id="page-title" class="hide"><\/span><span id="page-desc" class="hide"><\/span><span id="page-actions" class="hide"><\/span>',rah='<span>',j1g='<span>Search for:<\/span> <span id="radio-samples"><\/span><span id="radio-analyses"><\/span>',fch='<strong>',Dfh='<sub>',M8g='<sub>$1<\/sub>',oeh='<svg',C1g='<table class="info" cellspacing="0"><tbody>',D8g='<table>',kwg='<table><tbody>',bwg='<td',hwg="<td align='CENTER'>",jwg='<tr',E8g='<tr class=\\"" + CSS.TYPE_SMALL_CAPS\n\t\t\t\t\t+ "\\"><th>ppm<\/th><th>Element<\/th><\/tr>',H8g='<tr class=\\"" + CSS.TYPE_SMALL_CAPS\n\t\t\t\t\t+ "\\"><th>wt%<\/th><th>Element<\/th><\/tr>',L8g='<tr class=\\""+ CSS.TYPE_SMALL_CAPS +"\\"><th>ppm<\/th><th>Oxide<\/th><\/tr>',N8g='<tr class=\\""+ CSS.TYPE_SMALL_CAPS +"\\"><th>wt%<\/th><th>Oxide<\/th><\/tr>',F8g='<tr><td class="ppm">',I8g='<tr><td class="wt">',D1g='<tr><th>',Y9g='<tr><th>First Author:<\/th><td>',$9g='<tr><th>Full Citation:<\/th><td>',X9g='<tr><th>Journal:<\/th><td>',Z9g='<tr><th>Second Authors:<\/th><td>',W9g='<tr><
